import React from "react";
import proj1 from "../assets/proj1.png";
import proj2 from "../assets/proj2.png";
import proj3 from "../assets/proj3.png";
import proj4 from "../assets/proj4.png";
import About from "./About";
import ImageViewer from "./modal/ImageViewer";

const Galle = () => {
  return (
    <div className="py-6 max-w-[1200px] mx-auto">
      <div className="mb-4 flex items-center justify-between">
        <div className="flex flex-col gap-4">
          <h2 className="text-2xl lg:text-3xl text-white">
            My
            <span> Projects</span>
          </h2>
          <p className="text-gray-500">These are my projects.</p>
        </div>
      </div>

      <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-3 lg:grid-cols-4 gap-1 sm:gap-1 lg:gap-1">
        {/* Image 1 */}
        <div className="group h-48 w-48 md:h-64 md:w-64 overflow-hidden rounded-lg shadow-lg">
          <img
            src={proj1}
            loading="lazy"
            alt=""
            className="w-full h-full object-cover transition duration-200 group-hover:scale-110"
          />
        </div>

        {/* Image 2 */}
        <div className="group h-48 w-48 md:h-64 md:w-64 overflow-hidden rounded-lg shadow-lg ">
          <img
            src={proj4}
            loading="lazy"
            alt=""
            className="w-full h-full object-cover transition duration-200 group-hover:scale-110"
          />
        </div>

        {/* Image Viewer for Image 3 */}
        <div className="group h-48 w-48 md:h-64 md:w-64 overflow-hidden rounded-lg shadow-lg ">
          <ImageViewer src={proj3} alt="Project 3 image" />
        </div>

        {/* Image 4 */}
        <div className="group h-48 w-48 md:h-64 md:w-64 overflow-hidden rounded-lg shadow-lg ">
          <ImageViewer src={proj3} alt="Project 3 image" />
        </div>

        <div className="group h-48 w-48 md:h-64 md:w-64 overflow-hidden rounded-lg shadow-lg ">
          <ImageViewer src={proj3} alt="Project 3 image" />
        </div>
      </div>

      <div className="border-b border-gray-400 py-10"></div>
      <About />
    </div>
  );
};

export default Galle;
